import React from 'react'
import "./Navbar.css"
import Link from '../Link/Link'

const Navbar = () => {

  const links = [{id:1, name:"home"}, {id:2, name:"about"}, {id:3, name:"service"}, {id:4, name:"blog"}, {id:5, name:"contact"}]
  return (
    <header>
      <img src='./Exlogo.png' alt='logo' />
      <nav>
        {links.map(link => <Link key={link.id} name = {link.name}/>)}
      </nav>
    </header>
  )
}

export default Navbar
